const buttonShow=document.querySelectorAll(".button-show");buttonShow.forEach(t=>{t.addEventListener("click",function(e){let o=t.getAttribute("data-td"),n=t.getAttribute("data-state");"close"==n?(document.querySelector("#tr-two-"+o).classList.remove("d-none"),t.setAttribute("data-state","open")):"open"==n&&(document.querySelector("#tr-two-"+o).classList.add("d-none"),t.setAttribute("data-state","close"))})});